import React from 'react'
import styled from "styled-components";

const More = () => {
    return (
     <Body><h1>Setting</h1><i class="far fa-cog"></i>

{/* <v></v> */}
     </Body>
    )
}

const Body = styled.nav`
v{
    border-left: 1px solid;
    height: 2250px;
    position: absolute;
    left: 15%;
   
    top: 11%;}

i{
    font-size:16px;
    display:flex;
}    
    
    `
export default More
